    "You must be over 13 to share a full profile. If you are over 13, make sure that you have specified a birth year on the {account_settings_page_link}": "Musisz mie\u0107 uko\u0144czone 13 lat, aby m\u00f3c udost\u0119pni\u0107 sw\u00f3j pe\u0142ny profil. Je\u015bli masz uko\u0144czone 13 lat, upewnij si\u0119, \u017ce wprowadzi\u0142e\u015b rok urodzenia w {account_settings_page_link}", 
